" 0 1 (fontified t)) . -17260) ((marker . 17056) . -1) ((marker . 17273) . -1) ((marker . 17273) . -1) ((marker . 17263) . -1) nil (#("dd($taskAssign->errors());" 0 3 (fontified t) 3 4 (fontified t face default) 4 14 (fontified t face font-lock-variable-name-face) 14 16 (fontified t) 16 22 (fontified t face default) 22 26 (fontified t)) . -17261) ((marker . 17263) . -26) ((marker) . -26) 17261 (t 21916 49024 0 0) nil (18030 . 18035) nil (nil rear-nonsticky nil 18029 . 18030) (nil fontified nil 16778 . 18030) (16778 . 18030) nil (#("    public function testGetTotalNumAttribute()
    {
        $param =['job_documents' => [1, 2]];
        $this->createDocumentTables($param);
        $job = FactoryMuffin::create('DataEntry\\FactoryMuffin\\Job');
        $job->makeTestProductions();

        // cores.evaluator = \"all\"の場合
        $this->assertEquals(15, $job->total_num);

        // 必要生産件数を増やした場合
        foreach ($job->taskAssigns as $taskAssign) {
            $taskAssign->workload_limit = 10;
            $taskAssign->update();
            // $taskAssign->update([
            //     'workload_limit' => 10
            // ]);
            dd($taskAssign->errors());
 
            // Log::debug($taskAssign->workload_limit);
        }
        dd($job->taskAssigns->toArray());        
        $this->assertEquals(150, $job->total_num);

        // cores.evaluator = 'ignore'の場合
        $core = $job->cores->first();
        $core->evaluator = 'ignore';
        $core->update();
        $this->assertEquals(15, $job->total_num);

        //入稿途中のケースを再現（15ではなく0が正しい）
        foreach ($job->jobImports as $jobImport) {
            $jobImport->run_state = 'waiting';
            $jobImport->update();
        }
        $this->assertEquals(0, $job->total_num);

        //入稿エラーのケースを再現（15ではなく0が正しい）
        foreach ($job->jobImports as $jobImport) {
            $jobImport->import_state = 'error';
            $jobImport->run_state = 'available';
            $jobImport->update();
        }
        $this->assertEquals(0, $job->total_num);
    }
